import React, {useState} from "react";

const Recipe = () => {
    const [recipes, setRecipes] = useState([])

    return(
        <Container>
            <Table>
                <tbody>
                    <tr>
                        <td></td>
                    </tr>
                    <tr>
                        <td></td>
                    </tr>
                </tbody>
            </Table>
        </Container>
    )
}

export default Recipe
